import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 18.2-265.13 Confidentiality of data in possession of Department.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-265.13.md","filePath":"vacode/18.2-265.13.md"}'),r={name:"vacode/18.2-265.13.md"},n=o('<h1 id="§-18-2-265-13-confidentiality-of-data-in-possession-of-department" tabindex="-1">§ 18.2-265.13 Confidentiality of data in possession of Department. <a class="header-anchor" href="#§-18-2-265-13-confidentiality-of-data-in-possession-of-department" aria-label="Permalink to &quot;§ 18.2-265.13 Confidentiality of data in possession of Department.&quot;">​</a></h1><p>All data, records, and reports related to the sale of ephedrine or related compounds to retail customers and any abstracts of such data, records, and reports that are in the possession of the Department pursuant to this article shall be confidential and exempt from the Virginia Freedom of Information Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-3700/" target="_blank" rel="noreferrer">2.2-3700</a> et seq.) and the Government Data Collection and Dissemination Practices Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-3800/" target="_blank" rel="noreferrer">2.2-3800</a> et seq.).</p><p>2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0160" target="_blank" rel="noreferrer">160</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0252" target="_blank" rel="noreferrer">252</a>.</p>',3),i=[n];function s(d,l,c,f,p,_){return t(),a("div",null,i)}const g=e(r,[["render",s]]);export{m as __pageData,g as default};
